measurements.description:
Sixty-eight flowers on one looping, branched inflorescence; 

	dorsal sepal brown, yellow picotee, margin crisped;
	lateral sepals falcate, brown, yellow margin at apex, margins undulate;
	petals brown on proximal two-thirds, yellow distal one-third, curved toward column, interlocking at apex;


lip ochre, stellate callus cream overlaid gold; column olive;

substance medium; texture matte.
